    public void separarCadena() {        
        //obtengo las palabras
        String palabras = aux;//Palabras.getText();
        //separo en un arreglo
        String[] ArregloPalabras = palabras.split(" ");//10,000
        int multiplicador = 1000;
        String[] mamadisimo = new String[ArregloPalabras.length*multiplicador];//10,000*multiplicador
        for (int i = 0; i < multiplicador; i++) {
            for (int j = 0; j < ArregloPalabras.length; j++) {
                int num = (i*ArregloPalabras.length)+j;
                mamadisimo[num] = ArregloPalabras[j];
            }
        }
        //normal
        inicio = System.currentTimeMillis();
        //contandoPalabras(ArregloPalabras);
        contandoPalabras(mamadisimo);
        total = System.currentTimeMillis();
        //fork join
        ForkPalindroma f = new ForkPalindroma(mamadisimo);
        String n =String.valueOf(f.texto);
        ForkJoinT.setText(n);
        //executor
        ExecutorPalindroma e = new ExecutorPalindroma(mamadisimo);
        n = e.setTextExe();
        ExecutorT.setText(n);        
    }

    public void contandoPalabras(String[] palabras) {      
        System.out.println(palabras.length);
        for (int i = 0; i < palabras.length; i++) {
            int inc = 0;
            int des = palabras[i].length() - 1;
            boolean bError = false;

            while ((inc < des) && (!bError)) {

                if (palabras[i].charAt(inc) == palabras[i].charAt(des)) {
                    inc++;
                    des--;
                } else {
                    bError = true;
                }
            }

            if (!bError) {
                contadorPalabras++;
            }
        }        
    }
